INSERT INTO `news` VALUES ('11', '今后5年北京加大供应 将建租赁住房50万套', null, '<h1 id=\"title\" style=\"margin-bottom: 0px; padding: 15px 10px 0px; outline-style: none; outline-width: initial; font-weight: 800; font-size: 24px; line-height: 35px; text-align: center;\">今后5年北京加大供应 将建租赁住房50万套</h1><div class=\"blank10\" style=\"clear: both; font-size: 1px; overflow: hidden; height: 10px;\"></div><div id=\"riqi\" class=\"plr10 tc\" style=\"text-align: center; padding: 0px 10px; height: 27px; line-height: 27px; color: rgb(149, 149, 149); border-style: solid; border-color: rgb(223, 223, 223); border-image: initial; border-width: 1px 0px; margin: 0px 10px; vertical-align: top;\">发布时间：2017-05-25&nbsp;&nbsp;来源：新华网&nbsp;&nbsp;点击:<span class=\"fcr\" style=\"color: rgb(204, 0, 0);\">6</span>次</div><div class=\"blank15\" style=\"clear: both; font-size: 1px; overflow: hidden; height: 15px;\"></div><div class=\"con\" id=\"zoom\" style=\"width: 672.594px; margin: 0px auto; line-height: 28px; font-size: 15.9996px; overflow: hidden; word-wrap: break-word;\"><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-align: center;\"><img id=\"{8382BC1C-8A77-419E-B611-5DFC05740E94}\" title=\"\" border=\"0\" src=\"http://www.fcxzx.cn/userfiles/image/20170525/25142107b29d45b0442847.jpg\" align=\"center\" sourcedescription=\"编辑提供的本地文件\" sourcename=\"本地文件\" style=\"border-width: initial; border-style: none; max-width: 100%; margin: 10px 0px; height: 424px; width: 600px;\"></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　5月24日，<a href=\"http://www.fcxzx.cn/#\" class=\"p_wordlink\" target=\"_blank\" style=\"color: rgb(238, 0, 0); outline-style: none; outline-width: initial;\">北京</a>市海淀区唐家岭集体建设用地建设的927套租赁住房，正式面向海淀区<a href=\"http://www.fcxzx.cn/#\" class=\"p_wordlink\" target=\"_blank\" style=\"color: rgb(238, 0, 0); outline-style: none; outline-width: initial;\">保障房</a>家庭开展现场选房、签约入住工作。据悉，今后5年，北京将继续加大租赁住房供应，计划供地1300公顷，建设租赁住房50万套，并主要通过集体建设用地安排。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　北京市住建委介绍，唐家岭项目为北京利用集体建设用地建设租赁住房的第一批试点项目，共可提供租赁住房2176套，此次选房入住的是已竣工的927套房源。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　该项目由海淀区住房保障事务中心整体趸租，租期十年，统一进行出租、运营和管理。租赁住房由政府按市场价格趸租过来，再向保障房家庭按公租<a href=\"http://www.fcxzx.cn/#\" class=\"p_wordlink\" target=\"_blank\" style=\"color: rgb(238, 0, 0); outline-style: none; outline-width: initial;\">房价</a>格出租，差价由政府补贴。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　据悉，2011年起，北京在朝阳区平房乡、海淀区唐家岭、昌平区北七家镇等5个集体建设用地地块开展租赁住房项目试点，可供应租赁住房1.28万套，面向周边产业园区职工、外来务工人员出租，或由区政府按市场价格整体趸租作为公租房，面向城镇中低收入家庭出租。年内，北京集体建设用地建设租赁住房项目将陆续完成选房入住工作。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　北京市住建委介绍，5个试点项目主要分布在重点产业功能区周围，均有大量且稳定可期的租赁需求。如唐家岭项目，去中关村和上地这两个IT产业聚集地通勤非常便捷；平房乡项目邻近CBD商务中心区；温泉351项目作为海淀区创客人才公租房试点项目，打造双创示范基地；北七家镇项目受众人群主要为未来科技城企业员工及中关村科技园区昌平园区企业人才。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　北京租赁住房将重点在毗邻产业园区、交通枢纽和新城的区域布局建设，周边市政配套设施和公共服务设施相对齐全，交通较为便利，充分解决周边就业人群的住房需求，促进职住平衡。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">　　此外，北京将总结试点项目建设运营经验，加快完善相关支持政策，创新融资模式，还将对租赁住房性质和用途进行严格监管，租金按周边市场租金水平确定，充分保障农民利益，凡租给保障房对象的，还可享受相关税费优惠政策。（记者邓琦）</span></p><div><span style=\"font-family: 宋体, SimSun; font-size: 14px;\"><br></span></div></div>', '2017-05-30 11:03:48', '0');
INSERT INTO `news` VALUES ('12', '王健林去印度发展房地产了 万达要在印度拿地', null, '<h1 id=\"title\" style=\"margin-bottom: 0px; padding: 15px 10px 0px; outline-style: none; outline-width: initial; font-weight: 800; font-size: 24px; line-height: 35px; text-align: center;\">王健林去印度发展房地产了 万达要在印度拿地</h1><div class=\"blank10\" style=\"clear: both; font-size: 1px; overflow: hidden; height: 10px;\"></div><div id=\"riqi\" class=\"plr10 tc\" style=\"text-align: center; padding: 0px 10px; height: 27px; line-height: 27px; color: rgb(149, 149, 149); border-style: solid; border-color: rgb(223, 223, 223); border-image: initial; border-width: 1px 0px; margin: 0px 10px; vertical-align: top;\">发布时间：2017-05-12&nbsp;&nbsp;来源：北京晨报&nbsp;&nbsp;点击:<span class=\"fcr\" style=\"color: rgb(204, 0, 0);\">20</span>次</div><div class=\"blank15\" style=\"clear: both; font-size: 1px; overflow: hidden; height: 15px;\"></div><div class=\"con\" id=\"zoom\" style=\"width: 672.594px; margin: 0px auto; line-height: 28px; font-size: 15.9996px; overflow: hidden; word-wrap: break-word;\"><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">别理会他人闲言闲语，今日随他们，让他们说吧，你的机会将会到来，再来证明自己。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">这是电影《摔跤吧，爸爸》中的一句经典台词。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">最近，这部根据真人真事改编的励志影片，再次让世界见识到了印度电影的水平。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em; text-align: center;\"><img src=\"http://www.fcxzx.cn/userfiles/image/20170512/12121054979c70ac103969.jpg\" border=\"0\" width=\"537\" height=\"354\" style=\"vertical-align: top; max-width: 620px; width: auto; height: 311px; overflow: hidden; visibility: visible; opacity: 1;\"></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">▲《摔跤吧，爸爸》剧照</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">在印度，尤其在农村，一位女性练摔跤会被视为“不务正业”。如果说影片女主角成为国际摔跤冠军，是对印度传统文化的一种突破，那么现在，印度的<a href=\"http://www.fcxzx.cn/#\" class=\"p_wordlink\" target=\"_blank\" style=\"color: rgb(238, 0, 0); outline-style: none; outline-width: initial;\">房地产</a>也正在实现一次突破。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">从2015年的“人人有屋住”（Housing for All）计划开始，印度总理莫迪就致力于给印度人民提供经济房。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">在近13亿人口的国家，这项计划肯定会步履维艰，但是，全球很多大企业都已经盯上了这块市场，其中就包括中国的复星国际和万达集团。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">印度大力发展房地产，1.3万亿美元虎视眈眈</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">在印度，你往往可以看到一种奇特的景观——贫民窟与豪宅区紧密相连。印度不缺富豪，英国管理咨询公司Ahmadoff &amp; Company此前对历年福布斯全球富豪榜的分析显示，在过去的20年里，印度人在“世界亿万富豪俱乐部”中的占比，已经从1%上升到了5%。截至2017年，共有101位印度亿万富翁登上福布斯排行榜。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">但现在，印度总理莫迪从穷人中发现了国家经济增长的动力。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">5月9日，里昂证券印度公司预计，从2018年到2024年之间，印度将建造6000万套新住宅，每年将会创造约200万个就业岗位，并为印度GDP增长贡献75个基点。到2024年，社会保障性住房的数量将上升近70%，达到1050万，这将超过高端市场33%的增长量。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">里昂证券做出的上述预测，是基于莫迪的一项宏伟计划——未来20年内，政府将使13亿人口都有住房、帮助他们实现收入增长和消费水平的提升，而这项计划会吸引1.3万亿美元资金进入房地产市场。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">在2015年6月，政府发起了“全民有房住”计划，计划在全国建设2000万套房屋，在2015年12月份，政府也公布了该计划下的住房贷款利息豁免政策。</span></p><p style=\"margin-bottom: 10px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px; line-height: 1.75em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 14px;\">在去年11月份莫迪宣布“废钞令”后，印度房地产行业增速变缓。不过现在，市场已经出现反弹迹象。今年2月份起，政府开始给经济适用房建造商提供奖励、补贴和税收优惠。</span></p><p style=\"margin-bottom: 0px; padding: 0px; outline-style: none; outline-width: initial; font-family: SimSun, san-serif; font-size: 15.9996px;\"><br></p></div>', '2017-05-30 11:04:20', '0');

